import React from "react";

function Item(props){

    return(
    <li className="list-group-item">
        <img src={props.img} alt={`icon  ${props.id}`}/>
        <input type="checkbox" id={props.id}/>
        <label htmlFor={props.id} >{props.midea}</label>
        
    </li>
    );

}
export default Item;
